import axios from "axios";

export const CenterRestaurantAPI = async (
  bigLocation,
  smallLocation,
  setRestuarantData
) => {
  const url = `http://3.35.140.28:9000/shop/address?pageIndex=1&pageSize=10&first=%EC%84%9C%EC%9A%B8%ED%8A%B9%EB%B3%84%EC%8B%9C&second=%EC%84%B1%EB%B6%81%EA%B5%AC`;

  try {
    const data = await axios({
      method: "get",
      url: url,
    });
    console.log(data.data.result);
    // setRestuarantData(data.data.result);
  } catch (err) {
    alert(err);
  }
};

export default CenterRestaurantAPI;
